import React, { Component } from 'react'
import male7 from '../../src/images/male7.png'
import male15 from '../../src/images/male15.png'
import male25 from '../../src/images/male25.png'
import { Link } from 'react-router-dom'



export default class MalePics extends Component {
    constructor() {
        super()

        this.state = {
            bodyFat7: 0.7,
            bodyFat15: 0.15,
            bodyFat25: 0.25
        }


    }




    render() {


        return (
            <div>
                <Link  to={{ 
                        pathname: "/input", 
                        state: this.state.bodyFat7
                        }} ><img src={male7} alt="" /></Link>
                <Link to='/input'><img src={male15} alt="" /></Link>
                <Link to='/input'><img src={male25} alt="" /></Link>
            </div>
        )
    }
}
